import styled from "styled-components";

const Column = styled.div`
    display: flex;
    flex-direction: column;
    flex-wrap: nowrap;
`;

export default function FlexColumn({
    children,
}) {
    return(
        <Column>
            {children}
        </Column>
    );
}
